import Vue from 'vue';
import VueRouter from 'vue-router';

Vue.config.productionTip = false;
Vue.use(VueRouter);

import DashboardComponent from './components/DashboardComponent.vueboardComponent.vue';

const routes = [
    { path: '/', component: DashboardComponent }
]

const router = new VueRouter({
    mode: 'history',
    routes
})

new Vue({
    router,
    render: h => h(DashboardComponent)
}).$mount('#app');
